import React from 'react'
import { Link } from 'react-router-dom'
import { useState } from 'react';
import HireForm from './HireForm';
import HomeHire from './homeVol';
function Choice() {
  const [choice,setChoice] = useState(null);
  const [events, setEvents] = useState([]);
  const elelist=[<HireForm events={events} setEvents={setEvents}/>,<HomeHire/>]

  return (
    <div>
     <Link to="/hireform" className="btn btn-dark" onClick={() => setChoice(0)}>We Need Volunteers</Link>
     <Link to="/volunteer" className="btn btn-dark" onClick={() => setChoice(1)}>I Will Volunteer</Link>
     {elelist[choice]}
    </div>
  )
}

export default Choice
